onospace\"}} [:small \"(showing at most 100 rows)\"]] [:p/dataset {:columnDefs [{:headerName \"x\", :field \"x\"} {:headerName \"y\", :field \"y\"} {:headerName \"z\", :field \"z\"}], :rowData ({\"x\" 0, \"y\" 0.6465538682925076, \"z\" \\a} {\"x\" 1, \"y\" 0.494184960287145, \"z\" \\b} {\"x\" 2, \"y\" 0.6693172857595291, \"z\" \\c} {\"x\" 3, \"y\" 0.7508877647620269, \"z\" \\a} {\"x\" 4, \"y\" 0.05048325194541359, \"z\" \\b} {\"x\" 5, \"y\" 0.933435957470285, \"z\" \\c} {\"x\" 6, \"y\" 0.6533176699541462, \"z\" \\a} {\"x\" 7, \"y\" 0.21597428055369983, \"z\" \\b} {\"x\" 8, \"y\" 0.0052762887931026015, \"z\" \\c})}]]], \"158\" [:div nil nil [:p/markdown \"### md\\n\\nNotes of kind `:md` are rendering their values as markdown. More precisely, the value is printed, and the captured printed string is expected to be of Markdown format. If the value is sequential, then its elements are printed and concantenated as lines of one multi-line string, that is then treated as Markdown.\"]], \"201\" [:div nil nil [:p/markdown \"## Progress logging\\n\\nThis should be documented better soon.\"]], \"141\" [:div nil nil [:p/markdown \"### Atoms\"]], \"227\" [:div [:p/code {:code \"(future\\n  (Thread/sleep 2000)\\n  (->> #(- (rand) 0.5)\\n       (repeatedly 9)\\n       (reductions +)))\", :bg-class \"bg-light\"}] [:p {:style {:font-style \"italic\", :font-family \"\\\"Lucida Console\\\", Courier, monospace\"}} [:small \"(dereferenced)\"]] [:p/code {:code \"(0.2966093543220212\\n 0.6421192807787469\\n 0.15960992163241128\\n 0.6520494468950205\\n 0.17407081991775397\\n -0.2405255292655878\\n 0.07617499976889375\\n 0.24524001491776415\\n -0.03143601077645741)\\n\"}]], \"139\" [:div nil nil [:p/markdown \"If a note's value is a future, then Notespace will be informed when that future is realized. This allows Notespace to update its state with the dereferenced value.\\n\\nFor example, the following note should render after two seconds (of waiting for `x` to be realized).\"]], \"157\" [:div nil nil nil], \"185\" [:div [:p/code {:code \"^kind/math\\n(str \\\"(ax ^2 \\\"\\n     \\\"+ bx \\\"\\n     \\\"+ c \\\"\\n     \\\" = 0)\\\")\", :bg-class \"bg-light\"}] nil [:p/math \"(ax ^2 + bx + c  = 0)\"]], \"175\" [:div nil nil [:p/markdown \"### code\"]], \"155\" [:div [:p/code {:code \"^kind/void\\n(+ 1 2)\", :bg-class \"bg-light\"}] nil nil], \"202\" [:div [:p/code {:code \"(comment\\n  (require '[notespace.cljfx.api :as fx]) \\n\\n  (notespace/update-config #(assoc % :evaluation-callback-fn\\n                             (fn [idx note-count note]\\n                               (let [expected-duration (or  (get-in note [:duration]) 0)]\\n                                 (println \\\"evaluate note: \\\" idx \\\"/\\\" (dec note-count)\\n                                          \\\", expected duration (s): \\\"\\n                                          (if (pos? expected-duration)\\n                                            expected-duration\\n                                            \\\"???\\\"))))))\\n\\n  (notespace/update-config #(assoc % :in-eval-count-down-fn\\n                           (fn [seconds]\\n                             (println seconds))))\\n  (reset! state/the-context\\n          (fx/swap-context @state/the-context\\n                           #(-> % (assoc-in [:config :render-src?] false)))))\", :bg-class \"bg-light\"}] nil [:p/code {:code \"nil\\n\"}]], \"195\" [:div [:p/code {:code \"^kind/html\\n(str \\\"<h4>h4</h4>\\\"\\n     \\\"<h5>h5</h5>\\\")\", :bg-class \"bg-light\"}] nil [:p/html \"<h4>h4</h4><h5>h5</h5>\"]], \"118\" [:div [:p/code {:code \"(+ 1 2\\n   3 4\\n   5 6)\", :bg-class \"bg-light\"}] nil [:p/code {:code \"21\\n\"}]], \"193\" [:div nil nil [:p/markdown \"--------------------\"]], \"224\" [:div [:p/code {:code \"(require '[clojure.java.io :as io])\", :bg-class \"bg-light\"}] nil nil], \"196\" [:div nil nil [:p/markdown \"Notes which are sequential forms beginning with a string (e.g., `[\\\"Hello!\\\" \\\"How are you?\\\"]`) are assigned the default kind `:md-nocode`  automatically.\\nThis very text you are reading is an example of a note of that kind.\"]], \"207\" [:div nil nil [:p/markdown \"## Inferring note behaviors from types\\nIt is possible to infer a note's behavior from the type of its rendered, overriding the behavior prescribed by its kind. This can be done by extending the `Behaving` protocol.\"]], \"135\" [:div nil nil [:p/markdown \"If a note's value is a delay, then you can call `notespace.api/eval-and-realize-note-at-line` or `notespace.api/eval-and-realize-this-notespace` to realize it. Notespace will update its state with the dereferenced value.\\n\\nFor example:\"]], \"123\" [:div [:p/code {:code \"(def d1 (delay 11))\", :bg-class \"bg-light\"}] nil nil], \"116\" [:div nil nil [:p/markdown \"# Notespace v3 intro\\n\\n[Notespace](https://github.com/scicloj/notespace) is a library that turns any Clojure namespace into a 'notespace' -- a namespace with a [notebook](https://en.wikipedia.org/wiki/Notebook_interface) experience. A notespace evolves in an interactive process of exploration, involving a dialogue of your editor, your REPL, your browser and your mind.\\n\\nSo, `Notespace` with a capital `N` is the name of the tool, and `notespace` with a small `n` is the notion that we just presented.\\n\\nHere we describe an experimental incomplete draft of Notespace Version 3.\\n\\nIt is still a bit buggy around handling concurrency, updating efficiently and connecting to the browser. But the current version should be enough to start a community discussion around where we should be taking this.\"]], \"169\" [:div [:p/code {:code \"^kind/hiccup\\n(into [:ul]\\n      (for [i (range 9)]\\n        [:li\\n         i \\\" \\\"\\n         [:p/sparklinespot\\n          {:data      (for [j (range 999)]\\n                        (+ (* 0.2 (rand))\\n                           (Math/sin (* i j))))\\n           :limit     100\\n           :svgWidth  100\\n           :sv \" [:div nil nil [:p/markdown \"* a\\n* b\\n* c\\n* d\"]], \"192\" [:div [:p/code {:code \"^kind/dataset-grid\\n[{:a 1 :b 4}\\n {:a 2 :b 5}\\n {:a 3 :b 6}]\", :bg-class \"bg-light\"}] nil [:div {:class \"ag-theme-balham\", :style {:height \"150px\"}} [:p {:style {:font-style \"italic\", :font-family \"\\\"Lucida Console\\\", Courier, monospace\"}} [:small \"(showing at most 100 rows)\"]] [:p/dataset {:columnDefs [{:headerName \"a\", :field \"a\"} {:headerName \"b\", :field \"b\"}], :rowData ({\"a\" 1, \"b\" 4} {\"a\" 2, \"b\" 5} {\"a\" 3, \"b\" 6})}]]], \"213\" [:div [:p/code {:code \"(def ^{:doc \\\"When making a user extensible kind, you MUST assign the keyword\\nto a variable. Annotating with a keyword WILL NOT WORK!\\\"} just-code ::just-code)\", :bg-class \"bg-light\"}] nil nil], \"167\" [:div nil nil [:p/markdown \"### extended hiccup\\n\\nIn fact, `:hiccup` and `:hiccup-nocode` render by an extended version of Hiccup, that supports [gorilla-ui](https://github.com/pink-gorilla/gorilla-ui) tags.\\n\\nHere are some examples.\"]], \"197\" [:div nil nil [:p/markdown \"Notes which are forms like `(def ...)` or `(defn ...)` are assigned the kind `:void`.\"]], \"226\" [:div [:p/code {:code \"(copy \\\"https://clojure.org/images/clojure-logo-120b.png\\\"\\n      (notespace/file-target-path \\\"clojure.png\\\"))\", :bg-class \"bg-light\"}] nil [:p/code {:code \"nil\\n\"}]], \"228\" [:div [:p/code {:code \"(notespace/img-file-tag \\\"clojure.png\\\" {})\", :bg-class \"bg-light\"}] nil [:img {:src \"notespace-files/clojure.png\"}]], \"115\" [:div nil nil nil], \"225\" [:div [:p/code {:code \"(defn copy [uri file]\\n  (with-open [in  (io/input-stream uri)\\n              out (io/output-stream file)]\\n    (io/copy in out)))\", :bg-class \"bg-light\"}] nil nil], \"203\" [:div nil nil [:p/markdown \"## Overriding note kinds at runtime\\nIt is possible to override a note's kind during its evaluation using the `notespace.kinds/override` functions.\"]], \"172\" [:div nil nil [:p/markdown \"### vega\"]], \"176\" [:div nil nil [:p/markdown \"Some additional tags such as `:p/code` are added by the [gorilla-notes](https://github.com/scicloj/gorilla-notes) infrastructure.\"]], \"119\" [:div nil nil [:p/markdown \"Notespace renders it so that we see both the code and the evaluation result.\\n\\nAll your namespace is seen as a sequence of toplevel forms, which are considered as notes, and rendered accordingly.\"]], \"212\" [:div [:p/code {:code \"(defmethod\\n  ^{:doc\\n    \\\"Example of user extensible kind.\\nNote the ':reload true' in the :require vector:\\n[notespace.kinds :as k :reload true].\\nThis will make REPL testing your extensible kind easier!\\\"}\\n  kind/kind->behaviour ::just-code\\n  [_]\\n  {:render-src?   true\\n   :value->hiccup (constantly nil)})\", :bg-class \"bg-light\"}] nil [:p/code {:code \"#multifn[kind->behaviour 0x319f0df4]\\n\"}]], \"145\" [:div nil nil [:p/markdown \"If you evaluated the code in the comment below once, then you should see `{:x 4}`. Otherwise, you should still see `{:x 3}`.\"]], \"128\" [:div nil nil [:p/markdown \"### More API functions\\n\\nNotespace offers some more API functions that allow for a dynamic experience with Clojure references.\"]], \"199\" [:div [:p/code {:code \"(+ 1 2)\", :bg-class \"bg-light\"}] nil [:p/code {:code \"3\\n\"}]], \"210\" [:div [:p/code {:code \"(DummyType1. [:big [:big 3]])\", :bg-class \"bg-light\"}] nil [:big [:big 3]]], \"186\" [:div nil nil [:p/markdown \"### dataset\\n\\nNotes of kind `:dataset` are expecting a dataset that prints nicely as a table in markdown (for exaple, a dataset of the [tech.ml.dataset](github.com/techascent/tech.ml.dataset) and [Tablecloth](https://github.com/scicloj/tablecloth) libraries).\\n\\nIt wraps the resulting markdown with nice Bootstrap CSS classes, so that the table is displayed nicely.\\n\\nWe do not have an example here, since that would require depending on the above libraries.\"]], \"152\" [:div [:p/code {:code \"^kind/naive\\n(->> (partial rand-int 6)\\n     (partial repeatedly 6)\\n     (repeatedly 6))\", :bg-class \"bg-light\"}] nil [:p/code {:code \"((0 3 4 1 3 2)\\n (5 5 4 2 2 5)\\n (3 3 0 4 0 3)\\n (0 5 2 3 4 5)\\n (3 2 2 4 3 3)\\n (2 5 3 0 3 4))\\n\"}]], \"181\" [:div [:p/code {:code \"^kind/code\\n(pr-str '(defn abcd [x] (+ x 9)))\", :bg-class \"bg-light\"}] nil [:p/code \"(defn abcd [x] (+ x 9))\"]], \"184\" [:div [:p/code {:code \"^kind/math\\n[\\\"(ax ^2 + bx + c = 0 )\\\"\\n \\\"(dx ^2 + ex + f = 0 )\\\"]\", :bg-class \"bg-light\"}] nil [:div [:p/math \"(ax ^2 + bx + c = 0 )\"] [:p/math \"(dx ^2 + ex + f = 0 )\"]]], \"173\" [:div nil nil [:p/markdown \"The `vega` kind supports both Vega and Vega-Lite visualizations.\"]], \"190\" [:div [:p/code {:code \"^kind/dataset-grid\\n{:a [1 2 3]\\n :b [4 5 6]}\", :bg-class \"bg-light\"}] nil [:div {:class \"ag-theme-balham\", :style {:height \"150px\"}} [:p {:style {:font-style \"italic\", :font-family \"\\\"Lucida Console\\\", Courier, monospace\"}} [:small \"(showing at most 100 rows)\"]] [:p/dataset {:columnDefs [{:headerName \"a\", :field \"a\"} {:headerName \"b\", :field \"b\"}], :rowData ({\"a\" 1, \"b\" 4} {\"a\" 2, \"b\" 5} {\"a\" 3, \"b\" 6})}]]], \"222\" [:div [:p/code {:code \"(spit (notespace/file-target-path \\\"dummy.txt\\\")\\n      \\\"hi!\\\")\", :bg-class \"bg-light\"}] nil [:p/code {:code \"nil\\n\"}]], \"148\" [:div nil nil [:p/markdown \"## Note kinds\\n\\nEach note has a kind, that determines its rendering behaviour.\\n\\nOne way to specify a note's kind is by metadata. For example, here is a note of kind `:hiccup`.\"]], \"208\" [:div [:p/code {:code \"(require '[notespace.behavior])\", :bg-class \"bg-light\"}] nil nil], \"137\" [:div nil nil [:p/markdown \"If you have called `notespace.api/eval-and-realize-note-at-line` with the line holding this note, or `notespace.api/eval-and-realize-this-notespace` with this notespace, then you should see the number 3 there. Otherwise, you should see a mark that says it is still pending.\"]], \"136\" [:div [:p/code {:code \"(delay (+ 1 2))\", :bg-class \"bg-light\"}] [:p {:style {:font-style \"italic\", :font-family \"\\\"Lucida Console\\\", Courier, monospace\"}} [:small \"(delay - not running yet ...)\"]] [:p/code {:code \"nil\\n\"}]], \"166\" [:div nil nil [:big [:big 3]]], \"121\" [:div nil nil [:p/markdown \"### Editor integration\\n\\nFor a convenient interactive experience, it is ecommended to bind the Notespace API functions to functions of your editor.\\n\\nYou can see how to do this in Emacs in [this Elisp code](https://github.com/scicloj/notespace/blob/v3/emacs-config.el). In the future, we will probably provide similar solutions for other editors too.\"]], \"218\" [:div [:p/code {:code \"(fact\\n (+ 1 2) => 3)\", :bg-class \"bg-light\"}] nil [:div [:big [:big {:style {:color \"darkgreen\"}} \"✓\"]] \"   true\"]], \"194\" [:div nil nil [:p/markdown \"### Plain html\"]], \"168\" [:div [:p/code {:code \"^kind/hiccup\\n[:div\\n [:h5 \\\"Plot:\\\"]\\n [:p/sparklinespot\\n  {:data      (->> #(- (rand) 0.5)\\n                   (repeatedly 99)\\n                   (reductions +))\\n   :svgHeight 20}]]\", :bg-class \"bg-light\"}] nil [:div [:h5 \"Plot:\"] [:p/sparklinespot {:data (0.40082658601293786 0.3978541626977834 0.6881592227550195 0.19505307830052043 0.3742421829963022 0.690048297578039 0.43142002316742967 0.34830805486959937 -0.08687060315312722 -0.09262557710365005 -0.04551664997331384 -0.2554553275371969 0.09981960523739464 0.13044072732707102 -0.10676767794329156 0.29875524648025686 -0.11165642414246868 0.19220604429297106 -5.614836192580075E-4 -0.2178218564022092 -0.08645119721770755 0.09318507739588999 -0.03277382685312047 0.341405732284487 0.09309392805894035 0.183431180964981 0.4719325302977543 0.8035358529109483 0.786071829313434 0.5103332337071551 0.8533904478956427 1.1164157651049234 0.7228191483535034 1.1283576199776506 1.1331052861762418 1.367387497462888 1.390806975202862 1.6147425445335744 1.644276012792907 nil [:a {:href \"notespace-files/dummy.txt\"} \"dummy\"]], \"205\" [:div [:p/code {:code \"(-> [\\\"(ax ^2 + bx + c = 0 )\\\"]\\n    (kind/override kind/math))\", :bg-class \"bg-light\"}] nil [:div [:p/math \"(ax ^2 + bx + c = 0 )\"]]], \"122\" [:div nil nil [:p/markdown \"## References\\n\\nClojure references such as delays, futures, promises and atoms are handled by Notespace in a special way. Below we will see how Notespace offers ways to bring the dynamic REPL experience of such constructs to the dynamic browser view.\\n\\n### The rule of rendering\\n\\nAssume that a note's evaluation result `x` is a reference.\\n\\nIf `x` is already realized, then Notespace renders `@x` (dereferenced `x`) instead of `x`. In the rendering value, this is marked by `(dereferenced)`.\\n\\nOtherwise, you should see a mark that says it is still pending.\\n\\n\\nFor example:\"]], \"149\" [:div [:p/code {:code \"(require '[notespace.kinds :as k])\", :bg-class \"bg-light\"}] nil nil], \"120\" [:div nil nil [:p/markdown \"## Basic workflow\\n\\nTypically, you may like to edit one or more namespaces, that may be about function definitions, tests, data exploration, etc., and have Notespace update its notebook view while these namespaces evolve. At some point, you may like to render the view as a standalone html file for documentation.\\n\\nSee [this screencast](https://www.youtube.com/watch?v=_GcTnkhn9g0) for a recorded session. Note, however, that the note kinds defined in the screencast are a bit different from those of the current version.\\n### The main API functions\\n\\nLet us see how to get along with notespaces using the Notespace API.\\n#### init\\n\\nUse `notespace.api/init` to initialize the Notespace system's state.\\n\\nIn the beginning of your work, you need to use it.\\n\\nYou can also use it afterwards. That is useful if you run into an unstable state (yes, this may happen sometimes -- there may be some concurrency bugs).\\n#### init-with-browser\\n\\nUse `notespace.api/init-with-browser` to initialize the Notespace system's state and open a browser tab with a notebook view of the last namespace touched.\\n\\nIn the beginning of your work, you can use it instead of `init`.\\n\\nYou can always refersh the browser tab. That is useful if it runs out of sync with the system's state (yes, this may happen sometimes -- there may be some concurrency bugs).\\n#### eval-this-notespace\\n\\nUse `notespace.api/eval-this-notespace` to evaluate the current namespace, one note after another, and inform Notespace about the evaluation results, one after another.\\n\\nIf you have a browser view open, it should show the updated rendering of the state of the notespace last touched.\\n#### eval-note-at-line\\n\\nUse `notespace.api/eval-note-at-line` to evaluate the note at a certain line and inform Notespace about the evaluation result.\\n\\nFor example, `(notespace.api/eval-note-at-line 14)` applies that to the note at line 14.\\n\\nIf you have a browser view open, it should show the updated rendering of the state of the notespace last touched.\\n\\nThis is useful for re-evaluating parts of the notebook, whose evaluation result may have changed for some reason.\\n#### render-static-html\\n\\nUse `notespace.api/render-static-html` to render the Notespace state of the notespace last touched as a standalone html file. This html should look exactly as the dynamic browser view at the moment of rendering.\"]], \"206\" [:div [:p/code {:code \"(-> {:description \\\"A simple bar chart with embedded data.\\\"\\n     :data        {:values [\\n                            {:a \\\"A\\\" :b 28} {:a \\\"B\\\" :b 55} {:a \\\"C\\\" :b 43}\\n                            {:a \\\"D\\\" :b 91} {:a \\\"E\\\" :b 81} {:a \\\"F\\\" :b 53}\\n                            {:a \\\"G\\\" :b 19} {:a \\\"H\\\" :b 87} {:a \\\"I\\\" :b 52}\\n                            ]}\\n     :mark        :bar\\n     :encoding    {:x {:field :a :type :nominal :axis {:labelAngle 0}}\\n                   :
